var name_label = document.querySelector(".name__label");
var email_label = document.querySelector(".email__label");
var form = document.getElementById("form");
var loading = document.getElementById("loading");
var name = document.getElementById("name");
var email = document.getElementById("email");
var close = document.getElementById("close");
var send = document.getElementById("send");
var plan;
buttons.forEach(function (item) {
  return item.addEventListener("click", function (e) {
    e.preventDefault();
    document.body.style.overflow = "hidden";
    plan = e.target.value;
    modal.style.display = "block";
    outter.style.display = "block";
    inputs.forEach(function (item) {
      return item.value == plan ? item.checked = true : item.checked = false;
    });
  });
});

function changeName() {
  name_label.style.display = "block";
  name.style.backgroundColor = "#FFEEEE";
}

function changeEmail() {
  email_label.style.display = "block";
  email.style.backgroundColor = "#FFEEEE";
}

function undoName() {
  name_label.style.display = "none";
  name.style.backgroundColor = "#F2F2F2";
}

function undoEmail() {
  email_label.style.display = "none";
  email.style.backgroundColor = "#F2F2F2";
}

close.addEventListener("click", function (e) {
  e.preventDefault();
  outter.style.display = "none";
  modal.style.display = "block";
  loading.style.display = "none";
  document.body.style.overflow = "auto";
  form.reset();
  undoEmail();
  undoName();
});
send.addEventListener("click", function (e) {
  e.preventDefault();

  if (name.value === "") {
    changeName();
  }

  if (email.value === "") {
    changeEmail();
  }

  if (name.value !== "" && email.value !== "") {
    loading.style.display = "block";
    undoEmail();
    undoName();
    setTimeout(function () {
      outter.style.display = "none";
      loading.style.display = "none";
      document.body.style.overflow = "auto";
      form.reset();
    }, 3000);
  }
});
name.addEventListener("input", function () {
  name.value !== "" ? undoName() : changeName();
});
email.addEventListener("input", function () {
  email.value !== "" ? undoEmail() : changeEmail();
});

